== {{Crosstext|简介|ۖิ}} ==
脸红是一种无意识的生理反应。当人们情绪激动（害羞、紧张、兴奋或愤怒）的时候，大脑皮质会刺激肾上腺，使其分泌出少量肾上腺素，毛细血管扩张。于是脸就会发红。饮酒也会导致脸红。

